(18, 'service1', '    <div class=\"container my-5\">\r\n        <div class=\"row px-2\">\r\n            <div class=\"col-md-6 m-auto\">\r\n                <div class=\"row\">\r\n                    <div class=\"col-12 col_title\">\r\n                        <h4 class=\"clabel font-weight-bold\">自訂頁面</h4>\r\n                        <span class=\"elabel font-weight-bold\">Custom Page</span><hr class=\"mt-1\">\r\n                    </div>\r\n                </div>\r\n\r\n                <ul style=\"font-size:1rem; line-height:2rem\">\r\n                    <li>這是一個自訂區塊。</li>\r\n\r\n                    <li>您可以在這裡任意加上您所需要的內容。</li>\r\n\r\n                    <li>除了HTML之外，您可以加入CSS, Javascript來豐富您的版面。</li>\r\n\r\n                    <li>除此之外，您還可以在此區塊加入超連結，並連結到您新增的頁面內。</li>\r\n                    <li>範例: <a href=\"./test.html\" target=\"_blank\">這個連結</a>是開啟自訂頁面的連結</li>\r\n                    <li>範例: <a class=\"get_product blue-text\" data-pid=\"6\">這個連結</a>是開啟商品資訊</li>\r\n                </ul>\r\n            </div>\r\n        \r\n        <div class=\"col-md-6 px-4 m-auto\">\r\n            <img src=\"https://drive.google.com/uc?export=download&amp;id=1reU1yH5JJlUhWv-ffTVB4r35rsJt4uwV\" alt=\"\" class=\"img-fluid\">\r\n        </div>\r\n\r\n    </div>\r\n</div>\r\n', '服務項目1', 1, 2, 1, 1),
